import { Card } from 'react-bootstrap';
import { Link } from "react-router-dom";

const CategoryLinks = () => {
  return (

    <div>
      <h1>Categories</h1>
      <Card className="text-center">
        <Link to="/category"><Card.Header>Sport</Card.Header></Link>
        <Link to="/category"><Card.Header>Travel</Card.Header></Link>
        <Link to="/category"><Card.Header>Cars</Card.Header></Link>
      </Card>
    </div>
  )
}

export default CategoryLinks;
